  <script>
$(function(){
var tabs = $('.svg-circle a');
var counter = 0;
window.setInterval(activateTab, 5000);
function activateTab(){
// remove active class from all the tabs
debugger;

if(counter == 10)
{	
counter = 0;
}

tabs.removeClass('active');
tabs.removeClass('show');
var currentLink = tabs[counter];

$('.tab-pane').each(function(item , i){

i.classList.value = 'tab-pane';
});
currentLink.classList.value = 'nav-item nav-link active show';
var z = currentLink.href.animVal;
var t = $(z);
t.addClass('active').show();
if(counter < tabs.length)
counter= counter + 1;
else 
counter = 0;
}
});
  </script>